import Foundation
import XCTest

@testable import SystemStrings

// MARK: - CoreSpotlight Tests

@available(iOS 9.0, *)
final class CoreSpotlightStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜CoreSpotlight.preferredLocalization = nil
    }

